  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is comprised of 36 black and
  white 9x9 inch aerial images of four different study areas on Alaska's Arctic Coastal
  Plain taken between 1948-1949 and obtained from the Alaska Satellite Facility in
  2013. The images represent an historical snapshot of the landscape from that time.
  The images were scanned and geo-referenced to various contemporary (2002-2010) satellite
  imagery using tie-point methods and splines for interpolation.\",\n\t\"owner_org\":
